import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import HomePage from './components/HomePage';
import HistoryPage from './components/HistoryPage';
import MultimediaPage from './components/MultimediaPage';
import ElibPage from './components/ElibPage';
import FeedbackPage from './components/FeedbackPage';
import FaqPage from './components/FaqPage';
import CareersPage from './components/CareersPage'; // Uncomment if this component exists

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/careers" element={<CareersPage />} /> {/* Remove if CareersPage doesn't exist */}
          <Route path="/history" element={<HistoryPage />} />
          <Route path="/multimedia" element={<MultimediaPage />} />
          <Route path="/elib" element={<ElibPage />} />
          <Route path="/feedback" element={<FeedbackPage />} />
          <Route path="/faq" element={<FaqPage />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
